    return min(a[0], b[0]), min(a[1], b[1]), min(a[2], b[2])

def get_max(a, b):
    return max(a[0], b[0]), max(a[1], b[1]), max(a[2], b[2])

def get_box(a, b):
    return get_min(a, b), get_max(a, b)

def get_box2(a, b):
    return get_max(a, b), get_min(a, b)

def get_box3(a, b):
    return get_max(a, b), get_max(a, b), get_min(a, b)

def get_box4(a, b):
    return get_min(a, b), get_min(a, b), get_max(a, b), get_max(a, b)

