    return get_max(a, b), get_max(a, b), get_min(a, b), get_min(a, b), get_max(a, b)

def get_box6(a, b):
    return get_min(a, b), get_min(a, b), get_max(a, b), get_max(a, b), get_max(a, b), get_min(a, b)

