from collections import deque

def solve(a, b):
    if a == b:
        return 0
    if a % 2 == 1 or b % 2 == 1:
        return -1
    q = deque([(a, 0)])
    seen = set([a])
    while q:
        x, steps = q.popleft()
        if x == b:
            return steps
        for y in [x * 2, x * 4, x * 8, x // 2, x // 4, x // 8]:
            if y not in seen and y % 2 == 0:
                q.append((y, steps + 1))
                seen.add(y)
    return -1

