class Solution:
     def compareVersion(self, version1, version2):
         """
         :type version1: str
         :type version2: str
         :rtype: int
         """
         v1 = version1.split('.')
         v2 = version2.split('.')
         for i in range(max(len(v1), len(v2))):
             if i >= len(v1):
                 v1.append('0')
             if i >= len(v2):
                 v2.append('0')
             if int(v1[i]) > int(v2[i]):
                 return 1
             if int(v1[i]) < int(v2[i]):
                 return -1
         return 0

