def get(x):
    if l[x] == r[x]:
        return x
    else:
        return get(l[x]) if l[x] < r[x] else get(r[x])

def union(x, y):
    x = get(x)
    y = get(y)
    if x == y:
        return
    if l[x] < l[y]:
        l[x] = y
    else:
        r[x] = y

def check():
    for i in range(n):
        union(i, i + n)
    for i in range(n):
        if get(i) == get(i + n):
            return False
    return True

def dfs(x, y):
    if check():
        return True
    for i in range(n):
        if get(i) == get(i + n):
            continue
        if l[x] < l[i] and l[i] < r[x] and r[i] < r[x]:
            if dfs(i, x):
                return True
    return False

